// create web audio context
const context = new AudioContext();
const musicGainNode = context.createGain();
const sfxGainNode = context.createGain();
let testSoundBuffer = null;
let testMusicBuffer = null;

// set default music volume
musicGainNode.gain.value = 0.25;

// use inline sounds in this demo
const encodedSoundFile =
  "";
const encodedMusicFile =
  "";

// convert base64 to array buffer
const _base64ToArrayBuffer = (base64: string) => {
  const binary_string = window.atob(base64);
  const len = binary_string.length;
  const bytes = new Uint8Array(len);
  for (let i = 0; i < len; i++) {
    bytes[i] = binary_string.charCodeAt(i);
  }

  return bytes.buffer;
};

// load and play background music
context.decodeAudioData(_base64ToArrayBuffer(encodedMusicFile), buffer => {
  testMusicBuffer = buffer;
});

// load test sound
context.decodeAudioData(_base64ToArrayBuffer(encodedSoundFile), buffer => {
  testSoundBuffer = buffer;
});

const setMusicVolume = volume => {
  musicGainNode.gain.value = volume;
};

const setSfxVolume = volume => {
  sfxGainNode.gain.value = volume;
};

const playMusic = () => {
  if (testMusicBuffer) {
    const source = context.createBufferSource();
    source.loop = true;
    source.buffer = testMusicBuffer;
    source.connect(musicGainNode);
    musicGainNode.connect(context.destination);
    source.start(0);
  }
};

const playSound = () => {
  if (testSoundBuffer) {
    const source = context.createBufferSource();
    source.buffer = testSoundBuffer;
    source.connect(sfxGainNode);
    sfxGainNode.connect(context.destination);
    source.start(0);
  }
};

const createElement = <K extends keyof HTMLElementTagNameMap>(
  tagName: K,
  attrs?: Partial<HTMLElementTagNameMap[K]>
): HTMLElementTagNameMap[K] => {
  return Object.assign(document.createElement(tagName), attrs || {});
};

const style = createElement("style", {
  innerText:
    "body, button { font: 30px Arial, Helvetica, sans-serif; margin: 0; text-align: center; } div { margin: 30px 0; }"
});

const musicVolumeDiv = createElement("div", {
  innerText: "Music Volume: "
});

const sfxVolumeDiv = createElement("div", {
  innerText: "SFX Volume: "
});

const musicVolumeRange = createElement("input", {
  type: "range",
  min: "1",
  max: "100",
  value: "25",
  oninput: (e: any) => setMusicVolume(e.target.value / e.target.max)
});

const sfxVolumeRange = createElement("input", {
  type: "range",
  min: "1",
  max: "100",
  value: "75",
  oninput: (e: any) => setSfxVolume(e.target.value / e.target.max)
});

const playMusicDiv = createElement("div");

const playMusicButton = createElement("button", {
  innerText: "Play music",
  onclick: (e: any) => {
    playMusic();
    e.target.disabled = true;
  }
});

const playSoundDiv = createElement("div");

const playSoundButton = createElement("button", {
  innerText: "Play sound",
  onclick: () => playSound()
});

musicVolumeDiv.appendChild(musicVolumeRange);
sfxVolumeDiv.appendChild(sfxVolumeRange);
playMusicDiv.appendChild(playMusicButton);
playSoundDiv.appendChild(playSoundButton);

[style, musicVolumeDiv, sfxVolumeDiv, playMusicDiv, playSoundDiv].forEach(
  document.body.appendChild
);
